# Loop through each URL in the array and download the image
foreach ($url in $image_urls) {
    # Extract the filename from the URL
    $filename = [System.IO.Path]::GetFileName($url)

    # Download the image using Invoke-WebRequest
    try {
        Invoke-WebRequest -Uri $url -OutFile (Join-Path $download_dir $filename) -ErrorAction Stop
        Write-Host "Downloaded: $filename"
    } catch {
        # Download failed, log the error
        Write-Host -ForegroundColor Red "Failed: $filename"
        Add-Content -Path $download_errors_log -Value "`"$url`""
    }
}

# Check if any errors were logged 
if ((Get-Content $download_errors_log -Raw) -ne $null) {
    Write-Host "Some images downloaded."
    Write-Host "Download errors found, see log: $download_errors_log"
} else {
    Write-Host "All images downloaded successfully."
}
